import React from 'react';
import Blogpost from '../../../data.json';
import { NavLink } from 'react-router-dom';

function Post(props) {
  const post = Blogpost.data;
  return (
    <div>
      {post.map((post) => {
        return (
          <NavLink to={`/post/${post.id}`}>
            <h1>{post.blogTitle}</h1>;
          </NavLink>
        );
      })}
    </div>
  );
}

export default Post;
